import Cardcontent from "./cardcontent"
import style from "./cardcontent.module.css"
import data from "../workout.json"

function Cardcollection() {
    return (
        <div className={style.Cardcollection}>
            {console.log(data)}
            
        </div>
    )
}

export default Cardcollection;
